        BossModel.prototype.onBuyTimesReq = function (type) {
            var vo = boss.BossModel.getIns().getDailyTime(type);
            var buyEle = csv.DailyTimeProxy.getIns().getCfg(type);
            var buyMaxTime = csv.DailyTimeProxy.getIns().buytime(type);
            var buytime = vo.bnum;
            var num = vo.fnum + vo.gnum;
            if (buyEle.maxtime > 0 && num >= buyEle.maxtime) {
                manager.FlowManager.instance.flowByStyle1(app.getLang("shandong_error4"));
                return false;
            }
            if (buytime >= buyMaxTime) {
                if (vipcode.VipModel.getIns().isMaxLevel()) {
                    manager.FlowManager.instance.flowByStyle1(app.getLang("shandong_error3"));
                }
                else {
                    if (game.Context.disableIosRecharge()) {
                        manager.FlowManager.instance.flowByStyle1(app.getLang("shandong_error3"));
                    }
                    else {
                        manager.FlowManager.instance.flowByStyle1(app.getLang("shandong_error2"));
                    }
                }
                return false;
            }
            app.ProtocolRequest.BuyBossDailyReq(type);
            return true;
        };
