        BossModel.prototype.getCurOPenId = function () {
            var isChallenged = false;
            var bossListArr = csv.BossProxy.getIns().getCaveBoss();
            var lvbuff = fabaonew.FaBaoNewModel.getIns().getPlayMode(fabaonew.Etask_type.BossCaveNeedLevel);
            var teamlv = 0;
            for (var i = bossListArr.length - 1; i >= 0; i--) {
                teamlv = bossListArr[i].teamlv;
                teamlv = teamlv - lvbuff;
                isChallenged = boss.BossModel.getIns().isChallenged(bossListArr[i].id);
                if (game.Context.teamLv >= teamlv || isChallenged) {
                    return bossListArr[i].id;
                }
            }
            return 0;
        };
