            var cfg = csv.PeakProxy.getIns().getCfg(index);
            var arr = cfg.boxaura.split("-");
            var bs = new ByteStatus;
            var s = new Laya.Byte();
            s.writeByte(data.award);
            bs.init(0, s);
            var type1 = bs.read(0);
            var type2 = bs.read(1);
            var type3 = bs.read(2);
            if (type == 1 && type1 == 0) {
                if (data.exp >= parseInt(arr[0])) {
                    return true;
                }
            }
            if (type == 2 && type2 == 0) {
                if (data.exp >= parseInt(arr[1])) {
                    return true;
                }
            }
            if (type == 3 && type3 == 0) {
                if (data.exp >= parseInt(arr[2])) {
                    return true;
                }
            }
            return false;
