        /*
         *  cfg ===> shop.csv
         */
        ShopModel.prototype.getTimes = function (cfg) {
            var times = cfg.times;
            var max = 999;
            if (times != 1) {
                var price = this.real_price(cfg);
                var arr = app.str2Array(price, "-");
                var have = game.GridsModel.getIns().getItemCount(parseInt(arr[0]));
                var n = have / parseInt(arr[1]);
                max = Math.floor(n); //计算出最大可购买的数量
                if (max <= 0) {
                    max = 1;
                }
                if (times != 0 && max > times) {
                    max = times;
                }
                return max;
            }
            else if (times == 1) {
                return -1; //配置填写1的隐藏掉选择框
            }
            return max;
        };
