        XinFaModel.prototype.getGongMingAttr = function (id, role) {
            var _attr = {};
            var propsList = [];
            var list = csv.XinFanProxy.getIns().getSuitArrByItem(id.toString());
            if (list.length > 0) {
                var _xfSuitCfg = list[0];
                var selfCnt = XinFaModel.getIns().getSuitCntByCfgList(role, _xfSuitCfg); //自己拥有的套装数量
                for (var i = 0; i < list.length; i++) {
                    var cfg = list[i];
                    var cnt = parseInt(cfg.neednum);
                    var canAdd = false;
                    if (selfCnt >= cnt) {
                        canAdd = true;
                    }
                    var props = Attributes.decode(cfg.suitprop).baseList;
                    if (canAdd) {
                        propsList = propsList.concat(props);
                        _attr.cfg = _xfSuitCfg;
                    }
                    // this.addAttrList(props,"{0}+{1}",color,80);
                }
            }
            _attr.propsList = propsList;
            return _attr; // propsList;
        };
        /**
         * 获取该心法修炼的总属性
         * @param {Uint64} roleID
         * @returns {PropValue[]}
         */
        XinFaModel.prototype.getAllAttr = function (roleID) {
            var list = [];
            // let curID:number = undefined;
            // let gongmingsPv:PropValue[] = [];
            var arr = csv.XinFanProxy.getIns().posArr;
            this._cm.clear();
            for (var i = 0; i < arr.length; i++) {
                var cfg = arr[i];
                // let id:number = parseInt(cfg.id);
                var pos = parseInt(cfg.id); //position
                var __status = this.getIsOpen(roleID, pos);
                if (__status) {
                    var id = this.getXinFaId(roleID, pos);
                    if (id != undefined) {
                        var attrCfg = csv.XinFanProxy.getIns().cfgMap[id];
                        var attr = attrCfg.attr;
                        //基础属性
                        var cur = Attributes.decode(attr).baseList;
                        list = list.concat(cur);
                        //等级属性
                        var partPosLv = this.getLevel(roleID, pos);
                        var lvProps = XinFaModel.getIns().getLvProps(partPosLv);
                        list = list.concat(lvProps);
                        /*
                                                let _gm: PropValue[] = this.getGongMingAttr(id, roleID);
                                                // list = list.concat(gm);
                                                if (gongmingsPv.length <= 0 && _gm.length > 0) {
                                                    gongmingsPv = _gm;
                                                }
                        */
                        this._cm.push(id, roleID);
                    }
                }
            }
            var _results = this._cm.calculate(); //计算叠加态的套装总属性
            if (_results.length > 0) {
                list = list.concat(_results);
            }
            if (list.length > 0)
                list = Attributes.hebingAttributes(list);
            return list;
        };
