        /**
         * @param role
         * @param itemVO 用来检测的道具
         * @param _replaceCurCfg  如果非空,表示当前格子上的心法需要被替换
         */
        XinFaModel.prototype.isCanPush = function (role, itemVO, posType, replaceItemId /*,_replaceCurCfg:csv.IXinfaattrCfg*/) {
            /**当前检测目标的心法配置*/
            var _checkSuitCfg = csv.XinFanProxy.getIns().cfgMap[parseInt(itemVO.itemCfg.id)];
            if (posType == parseInt(_checkSuitCfg.postype)) {
                // let _replaceItemCfg: csv.IXinfaattrCfg = csv.XinFanProxy.getIns().cfgMap[replaceItemId];//替换位的配置
                //该葫芦娃身上所穿的装备
                var _equipList = XinFaModel.getIns().getEquiplist(role);
                if (_equipList && _equipList.length > 0) {
                    for (var n = 0; n < _equipList.length; n++) {
                        var _xinfaItemData = _equipList[n];
                        var _list = _xinfaItemData.vecItem;
                        if (_list && _list.length > 0) {
                            var item = _list[0];
                            if (replaceItemId && replaceItemId == item.itemId) {
                                //不检测需要被替换的装备
                            }
                            else {
                                var _wearCfg = csv.XinFanProxy.getIns().cfgMap[item.itemId]; //已经穿戴中的心法装备
                                if (_wearCfg.type == _checkSuitCfg.type && _wearCfg.subtype == _checkSuitCfg.subtype) {
                                    //type,subtype互斥,同一个格位,已经有同样属性的(type)心法穿着了,这里排除掉不放到可选列表中.
                                    return false;
                                }
                            }
                        }
                    }
                }
                return true;
            }
            return false;
        };
