        XinFaModel.prototype.filterEquip = function (role, arr, posType, replaceItemId /*, _xinfaCfg?: csv.IXinfaattrCfg*/) {
            var _list = [];
            for (var i = 0; i < arr.length; i++) {
                var item = arr[i];
                // if (_itemId && item.itemCfg.id == _itemId) {
                //     //相同的不需要
                // } else {
                // let suitCfg: csv.IXinfaattrCfg = csv.XinFanProxy.getIns().cfgMap[parseInt(item.itemCfg.id)];
                // if (posType == parseInt(suitCfg.postype)) {
                if (this.isCanPush(role, item, posType, replaceItemId)) {
                    _list.push(item);
                }
                // }
                // }
            }
            return _list;
        };
