        XinFaModel.prototype.isBetterThanOther = function (role, itemCfgId) {
            var attCfg = csv.XinFanProxy.getIns().cfgMap[itemCfgId];
            var ids = [];
            // let xinfaPosCfg: csv.IXinfacaseposCfg = csv.XinFanProxy.getIns().posMap[attCfg.postype];
            // let posType: number = xinfaPosCfg.type;
            var list = game.GridsModel.getIns().getGridByType(game.GridsModel.BAG_XINFA);
            var arr = list.itemList;
            // arr = this.filterEquip(item.xinfa.role, arr, item.posType, item);
            arr = this.filterEquip(role, arr, attCfg.postype, itemCfgId /*, attCfg*/);
            var stars = csv.XinFanProxy.getIns().cfgMap[itemCfgId].stars; //item.itemCfg.id
            for (var i = 0; i < arr.length; i++) {
                var id = arr[i].itemCfg.id;
                var cfg = csv.XinFanProxy.getIns().cfgMap[id]; //对比的配置
                if (stars < cfg.stars) {
                    // return id;
                    ids.push(id);
                }
            }
            return ids;
        };
